import React from "react";
import Slider from "react-slick";
import { sliderData } from "../../mockData/MockData";

export default class MovieSlider extends React.Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <div>
                <h2> Single Item</h2>
                <Slider {...settings}>

                </Slider>
            </div>
        );
    }
}
